import React, { Component } from 'react'

import './LazyLoadImage.css'


// Use for images that are already on the page
// 
// Example: 
//     <LazyLoadImage
//       src=""                   :str
//       style={{                 :obj
//        width: "50px",            :str !  // this width and height 
//        height: "50px"            :str !  // will take a spinner to be the size of a picture
//        borderRadius: "50%"
//       }}  
//      />
class LazyLoadImage extends Component {

  state = {
    imageStatus: false
  };

  handleImageLoaded = () => {
    this.setState({ imageStatus: true })
  }

  handleImageErrored = () => {
    this.setState({
      error: "Failed to load image...",
      imageStatus: true
    });
  }

  renderSpinner = () => {
    if (this.state.imageStatus) {
      return null;
    }
    const { width, height } = this.props.style;

    return (
      <img
        style={{ width, height }}
        className='lazy-load__spinner'
        src='data:image/gif;base64,'
      />
    )
  }

  renderError = () => {
    return this.state.error
      ? <div className="lazy-load__error">{this.state.error}</div>
      : null;
  }

  render() {
    return (
      <div className="lazy-load__container">
        {this.renderSpinner()}
        {this.renderError()}

        <img
          {...this.props}
          className={this.state.imageStatus ? "lazy-load__image" : "lazy-load__image--hidden"}
          onLoad={this.handleImageLoaded}
          onError={this.handleImageErrored}
        />
      </div>
    );
  }
}

export default LazyLoadImage;